// Get current timestamp in milliseconds
var currentTimestamp = new Date().getTime();

// Subtract 24 hours (in milliseconds)
var subtract24h = currentTimestamp - (24 * 60 * 60 * 1000);

// Convert to epoch time (in seconds)
var epochCurrent = Math.floor(currentTimestamp / 1000);
var epochSubtract24h = Math.floor(subtract24h / 1000);

// Output data
var msg = {
    currentTimestamp: epochCurrent,
    startTimestamp: epochSubtract24h
};

// Return generated message
return { msg: msg };

